import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./Styles/ProductCarousel.css";

// Import images from the Assets folder
import product1 from "../Assets/C1.JPG";
import product2 from "../Assets/C2.JPG";
import product3 from "../Assets/C3.JPG";

const ProductCarousel = ({ title }) => {
    const settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        arrows: true,
    };

    return (
        <div className="product-carousel">
            <h2>{title}</h2>
            <Slider {...settings}>
                <div className="product-item"><img src={product1} alt="Product 1" /></div>
                <div className="product-item"><img src={product2} alt="Product 2" /></div>
                <div className="product-item"><img src={product3} alt="Product 3" /></div>

            </Slider>
        </div>
    );
};

export default ProductCarousel;
